    constructor(){
        super();
    
    }
    render() {
        return (
            <div className="ToDoApp">
                 My ToDo Application 
                
            </div>
        );
    }
    
}

class LoginComponent extends Component{
    render() {
        return (<div>
            User Name : <input type="text" name="username"/>
            Password : <input type="password" name="password"/>
            </div>
        );
    }
}



export default ToDoApp;
